import Logo from "./logo";

function Signup() {
  return (
    <div className="flex min-h-screen justify-center items-center">
      <div className="border border-1 mt-2 h-signup-h w-signup-w">
        <Logo className="px-8" />
        <h1 className="font-roboto text-4xl text-gray-900 text-left px-6 py-6">
          Sign up
        </h1>
      </div>
    </div>
  );
}
export default Signup;
